[{"location":"InputFiles/#Esboço-da-documentação-do-novo-código-de-JuBEM","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"","category":"section"},{"location":"InputFiles/#Arquivos-de-entrada","page":"Esboço da documentação do novo código de JuBEM","title":"Arquivos de entrada","text":"","category":"section"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Na nova versão do JuBEM a intenção é separar os arquivos de entrada em dois, um que contém apenas os dados de malha, sendo o arquivo que vem direto do Gmsh em formato .msh, e outro que contém todas as outras informações necessárias para definição do problema e dos parâmetros de solução em formato .prob.","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Arquivos de malha gerados pelo gmsh, no momento, devem diferenciar as superfícies do problema ao atribuir superfícies físicas a estes. Esta diferenciação é utilizada dentro do programa para definir as condições de contorno das diferentes superfícies. Existe uma intenção em colocar outros tipos de entidades físicas também, como nós, arestas e etc, mas no momento isto ainda não é feito. A diferenciação é realizada por superfícies.","category":"page"},{"location":"InputFiles/#Arquivo-.prob","page":"Esboço da documentação do novo código de JuBEM","title":"Arquivo .prob","text":"","category":"section"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Arquivos .prob podem ter os seguintes blocos:","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"ProblemName (Obrigatório): Contém o nome do problema\nMaterial (Obrigatório): Contém as propriedades de cada material do problema\nMeshType (Obrigatório): Contém informações da ordem do elemento e do valor da descontinuidade.\nFrequencies: Contém as faixas de frequência de solução do problema dinâmico. (obrigatório para problema dinâmico)\nBoundaryConditions (Obrigatório): Contém as informações das diferentes condições de contorno, sendo elas o tipo da condição de contorno e seu valor.\nTagInformation (Obrigatório): Contém a associação entre o número da tag física proveniente do gmsh com os valores de condições de contorno e número do material.\nForces: Contém as informações das forças atuando sobre o corpo rígido. (Obrigatório para corpo rígido)","category":"page"},{"location":"InputFiles/#Descrições-dos-blocos-dos-arquivo-.prob","page":"Esboço da documentação do novo código de JuBEM","title":"Descrições dos blocos dos arquivo .prob","text":"","category":"section"},{"location":"InputFiles/#Bloco-TagInformation","page":"Esboço da documentação do novo código de JuBEM","title":"Bloco TagInformation","text":"","category":"section"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"O bloco TagInformation contém as seguintes informações:","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Ns\nidx_s1 bcidx_s1 matidx_s1 bodyidx_s1\nidx_s2 bcidx_s2 matidx_s2 bodyidx_s2\n...\nidx_sNs bcidx_sNs matidx_sNs bodyidx_sNs","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Ns é o número de superfícies físicas, idx_si é o índice da superfície física, bcidx_si é o índice da condição de contorno da superfície física i, matidx_si é o índice do material da superfície física i, bodyidx_si é o índice do corpo da superfície física i.","category":"page"},{"location":"InputFiles/#Bloco-BoundaryConditions","page":"Esboço da documentação do novo código de JuBEM","title":"Bloco BoundaryConditions","text":"","category":"section"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"O bloco BoundaryConditions contém as seguintes informações:","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Nbc\nidx_bc1 tipo_bcx valor_bcx tipo_bcy valor_bcy tipo_bcz valor_bcz\nidx_bc2 tipo_bcx valor_bcx tipo_bcy valor_bcy tipo_bcz valor_bcz\n...\nidx_bcNs tipo_bcx valor_bcx tipo_bcy valor_bcy tipo_bcz valor_bcz","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"Nbc é o número de condições de contorno, idx_bci é o índice da condição de contorno e em seguida é passada uma string que contém o tipo de condição de contorno em cada direção e seu valor. Condições de contorno suportadas são:","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"u: Deslocamento (Dirichlet)\nt: Tração superficial (Neumann)\nrb: Corpo rígido (Neste caso os valores são a posição do centróide)\nee: Enclosing Element (valores não tem importancia, mas devem ser passados, podem ser 0)\ni: Interface (valores devem ser 1 e -1 para cada lado da interface)","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"No programa JuBEM, cada uma destas será atribuída um valor numérico na variável problem.bctype, a relação dos valores é a seguinte:","category":"page"},{"location":"InputFiles/","page":"Esboço da documentação do novo código de JuBEM","title":"Esboço da documentação do novo código de JuBEM","text":"u: 1\nt: 2\nrb: 2+(idxrb)\nee: 0\ni: -1","category":"page"},{"location":"Types/#JuBEM-Types","page":"JuBEM Types","title":"JuBEM Types","text":"","category":"section"},{"location":"ApplyingBC/#Aplicação-das-condições-de-contorno","page":"Aplicação das condições de contorno","title":"Aplicação das condições de contorno","text":"","category":"section"},{"location":"ApplyingBC/#Aplicação-das-condições-de-contorno-de-solo-homogêneo-com-N-corpos-rígidos-(função-apply_BC)","page":"Aplicação das condições de contorno","title":"Aplicação das condições de contorno de solo homogêneo com N corpos rígidos (função apply_BC)","text":"","category":"section"},{"location":"ApplyingBC/","page":"Aplicação das condições de contorno","title":"Aplicação das condições de contorno","text":"No momento esta função funciona apenas para solos homogêneos. A intenção é que no futuro sirva também para heterogêneos","category":"page"},{"location":"ApplyingBC/","page":"Aplicação das condições de contorno","title":"Aplicação das condições de contorno","text":"Esboço:","category":"page"},{"location":"ApplyingBC/","page":"Aplicação das condições de contorno","title":"Aplicação das condições de contorno","text":"Definição do número de nós por elemento nnel\nCriação de uma nova matriz LM\nEsta matriz tem tamanho nnel,nel,3\nContém o grau de liberdade do nó local x elemento x direção\nDefinição de nu (número de condições de contorno de u)\nDefinição de nt (número de condições de contorno de t)\nDefinição dos índices dos elementos que possuem condições de contorno u e t (não vai funcionar diretamente com a nova organização dos dados)\nEncontra os índices dos elementos que são flexíveis\nConta quantos corpos rígidos existem nrrb\nCria um vetor que armazena quantos elementos existem em cada corpo rígido.\nCria vetor que contém os índices dos elementos rígidos\nCria vetores abstratos que vão conter os índices dos elementos de cada CR, e as matrizes C e D de cada CR\n","category":"page"},{"location":"EnclosingElements/#Enclosing-Elements","page":"Enclosing Elements","title":"Enclosing Elements","text":"","category":"section"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"No programa JuBEM, Enclosing Elements são utilizados para calcular as integrações singulares fortes através da teoria de deslocamento de corpo rígido em malhas de domínio infinito (em problemas de estática). Para isso, é necessário discretizar um domínio fechado com enclosing elements, que são integrados e cujas entradas são utilizadas no cálculo dos termos singulares fortes.","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"Após a integração, porém, deve haver uma tratamento para remover os termos de Enclosing Elements do problema, uma vez que não devem ser considerados (se fossem considerados, o domínio não seria infinito). Para isso, foi implementada a função remove_EE!(). A seguir esta função será explicada, junto da forma correta de tratar os dados que saem dela.","category":"page"},{"location":"EnclosingElements/#Função-remove_EE!()","page":"Enclosing Elements","title":"Função remove_EE!()","text":"","category":"section"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"Enclosing elements são identificados pelo tipo de condição de contorno bctype = 0. O tipo de condição de contorno é armazenado na variável problem.bctype. Esta variável possui tamanho nbcx4, onde nbc é o número de condições de contorno diferentes. as colunas contém o número da condição de contorno e o tipo de condição de contorno em cada direção. Uma vez que a condição de enclosing elements não depende da direção, então todas as entradas devem ter valor 0 e qualquer uma pode ser utilizada.","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"Inicialmente são encontrados os índices das condições de contorno de enclosing elements, chamados bctypeidxee. Então são encontrados os índices das tags (atribuídas a cada superfície) que possuem esta condição de contorno, tagidxee. Com isso, enfim podem ser encontrados os índices dos elementos que são enclosing elements, elemidxe, e os índices dos que não são, elemidxnonee.","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"O que precisamos fazer agora é atualizar as matrizes H e G para conter apenas as entradas de elementos que não são enclosing elements. Para isso, precisamos atualizar as matrizes dos graus de liberdade que são entradas destas matrizes, as matrizes ID e LM. Além disso, são atualizadas as matrizes de incidência dos elementos físicos e geométricos, IEN e IEN_geo. ","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"As matrizes de pontos e nós não são atulizadas, uma vez que a atualização destas iria requerer uma nova ordenação dos nós geométricos na matriz de incidência geométrica IEN_geo. Sendo assim, os números globais dos nós são preservados, mas os graus de liberdade dos nós físicos são alterados de forma a remover os graus de liberdade dos enclosing Elements.","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"Para isso ser possível, a matriz ID permanece com o mesmo tamanho que anteriormente, mas as colunas correspondentes aos nós físicos de enclosing elements são zeradas. A matriz LM por outro lado, agora tem um tamanho diferente, possuindo número de colunas igual ao número de elementos que não são enclosing elements.","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"Sendo assim, deve-se levar em consideração que os graus de liberdade devem sempre ser tratados utilizando as matrizes ID e LM.","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"Por fim, os seguintes valores também são atualizados:","category":"page"},{"location":"EnclosingElements/","page":"Enclosing Elements","title":"Enclosing Elements","text":"    mesh.nelem\n    mesh.nnodes\n    mesh.ID\n    mesh.LM\n    mesh.IEN\n    mesh.IEN_geo\n    mesh.tag","category":"page"},{"location":"#JuBEM-documentation","page":"JuBEM documentation","title":"JuBEM documentation","text":"","category":"section"},{"location":"","page":"JuBEM documentation","title":"JuBEM documentation","text":"calc_N_gen(nodal_csis,csis_grid;dg = :N)","category":"page"},{"location":"#JuBEM.calc_N_gen-Tuple{Any, Any}","page":"JuBEM documentation","title":"JuBEM.calc_N_gen","text":"N = calc_N_gen(nodal_csis,csis_grid;dg = :N)\n\nReturns a matrix. \nPossible values for dg are :N, :dNdc, :dNde, :d2Ndc2 and :d2Ndce\n\n\n\n\n\n","category":"method"},{"location":"","page":"JuBEM documentation","title":"JuBEM documentation","text":"link to JuBEM documentation\nlink to calc_N_gen(nodal_csis,csis_grid;dg = :N)","category":"page"}]
